CREATE DATABASE QLCH

GO

USE QLCH

GO

CREATE TABLE nhanvien 
(
  manv int PRIMARY KEY IDENTITY (1000000,10),
  tennv nvarchar(100),
  giottinh nvarchar(50),
  sdt nvarchar(20),
  email nvarchar(50),
  diachi nvarchar(100),
  cmnd nvarchar(12),
  passwword nvarchar(100),
  quyenhan int,
  trangthai int
)

CREATE TABLE khachhang 
(
  makh int PRIMARY KEY IDENTITY (1000000,10),
  tenkh nvarchar(100),
  gioitinh nvarchar(50),
  diachi nvarchar(200),
  sdt nvarchar(20),
)

CREATE TABLE dondathang 
(
  maddh int PRIMARY KEY IDENTITY (1000000,10),
  manv int FOREIGN KEY REFERENCES nhanvien (manv),
  makh int FOREIGN KEY REFERENCES khachhang (makh),
  ngaydathang datetime,
  trangthai int,
  ghichu nvarchar(300)
)

CREATE TABLE nhacungcap 
(
  mancc int PRIMARY KEY IDENTITY (1000000,10),
  tenncc nvarchar(200),
  sdt nvarchar(20),
  diachi nvarchar(200),
  email nvarchar(200)
)

CREATE TABLE loaihang 
(
  maloai int PRIMARY KEY IDENTITY (1000000,10),
  tenloai nvarchar(100)
)

CREATE TABLE hang 
(
  mahang int PRIMARY KEY IDENTITY (1000000,10),
  tenhang nvarchar(100),
  maloai int FOREIGN KEY REFERENCES loaihang (maloai)
)


CREATE TABLE sanpham 
(
  masp int PRIMARY KEY IDENTITY (1000000,10),
  tensp nvarchar(100),
  mahang int FOREIGN KEY REFERENCES hang (mahang), 
  anh varbinary(max),
  mota nvarchar(300)
)

CREATE TABLE ct_sanpham
(
  mactsp int PRIMARY KEY IDENTITY (1000000,10),
  tinhtrang int,
  soluong int,
  masp int FOREIGN KEY REFERENCES sanpham (masp),
  giaban bigint,
  giasale bigint,
  thoigianbh int,
)

CREATE TABLE ct_dondathang 
(
  mactddh int PRIMARY KEY IDENTITY (1000000,10),
  maddh int FOREIGN KEY REFERENCES dondathang (maddh),
 mactsp int FOREIGN KEY REFERENCES ct_sanpham(mactsp),
  tensp nvarchar(100),
  soluong int,
  giaban bigint,
  thoigianbatdau datetime,
  thoigianketthuc datetime,
  tinhtrang int,
  soserial nvarchar(500) NOT NULL
)

CREATE TABLE ct_baohanh 
(
  mactbh int PRIMARY KEY IDENTITY (1000000,10),
  mactddh int FOREIGN KEY REFERENCES ct_dondathang (mactddh),
  manv int FOREIGN KEY REFERENCES nhanvien (manv),
  ngaynhanmay datetime,
  ngaytradukien datetime,
  soserial nvarchar(500) NOT NULL,
  ngaytrathucte datetime,
  tinhtrang int
)

CREATE TABLE donhangnhap (
  madhn int PRIMARY KEY IDENTITY (1000000,10),
  manv int FOREIGN KEY REFERENCES nhanvien (manv),
  mancc int FOREIGN KEY REFERENCES nhacungcap (mancc),
  ngaynhaphang datetime,
  trangthai int,
  ghichu nvarchar(200)
)

CREATE TABLE ct_donhangnhap (
  mactdhn int PRIMARY KEY IDENTITY (1000000,10),
  madhn int FOREIGN KEY REFERENCES donhangnhap (madhn),
mactsp int FOREIGN KEY REFERENCES ct_sanpham(mactsp),
  giamua bigint,
  soluongmua int,
  tongtien bigint
)

CREATE TABLE thongsokythuat (
  matskt int PRIMARY KEY IDENTITY (1000000,10),
  ten nvarchar(100),
  thongsokythuat nvarchar(200),
  masp int FOREIGN KEY REFERENCES sanpham (masp),
  sothutu int,
  idparent int default 0,
  isdefault int default 0
)

CREATE TABLE loaithongso (
  malts int PRIMARY KEY IDENTITY (1000000,10),
  title nvarchar(200),
  id_parent int,
  stt int,
)

CREATE TABLE fillter_thong_so (
  id int PRIMARY KEY IDENTITY (1000000,10),
  matskt int FOREIGN KEY REFERENCES thongsokythuat (matskt),
  malts int FOREIGN KEY REFERENCES loaithongso (malts)
)

